import './../css/Home.css'
import Html5QrcodePlugin from '../components/QRCodeScanner'

const Home = () => {
    const onNewScanResult = (decodedText, decodedResult) => {
        // handle decoded results here
    };
    return (
        <div className="home">
            <div className="logForm">
                <Html5QrcodePlugin
                    fps={10}
                    qrbox={250}
                    disableFlip={false}
                    qrCodeSuccessCallback={onNewScanResult}
                />
            </div>
        </div>
    )
}

export {
    Home
}
